import { useEffect, useState } from 'react';
import { getImg } from '../utils/imageService';

const ImageRender = () => {
  const [image, setImage] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(false);
  console.log(image);
  useEffect(() => {
    const fetchDataAsync = async () => {
      setLoading(true);
      try {
        const images = await getImg('header');
        setImage(images);
      } catch (error) {
        setError(error);
      } finally {
        setLoading(false);
      }
    };
    fetchDataAsync();
  }, []);

  return <p>hei</p>;
};
export default ImageRender;
